comments:
[u"@execjosh, could you check this on Windows please? I can't build PhantomJS on Windows (current dev trunk, MSVC2010).

`childprocess.cpp(59): error C2027: use of undefined type '_PROCESS_INFORMATION'`", u"@Vitallium: Thanks for finding this!  Unfortunately, I don't have a Windows box anymore :(  Would it be possible for you to try to fix it?  Making a bug report in the [issue tracker][4] would be a big help, too, so we can document how to reproduce the bug and track its status :)

As I understand it, [`Q_PID`][1] is `typedef`ed to [`_PROCESS_INFORMATION *`][2] in [`qprocess.h`][3] on Windows; so, it should have Just Worked™.  Maybe `windows.h` or `qt_windows.h` needs to be explicitly `#include`d in childprocess.cpp?  If worse comes to worst, we might have to just paste in the following definition ([from MSDN][2]):

```c++
#if defined(Q_OS_WIN32) || defined(Q_OS_WINCE)
typedef struct _PROCESS_INFORMATION {
  HANDLE hProcess;
  HANDLE hThread;
  DWORD  dwProcessId;
  DWORD  dwThreadId;
} PROCESS_INFORMATION, *LPPROCESS_INFORMATION;
#endif
```

[1]: http://qt-project.org/doc/qt-4.8/qprocess.html#Q_PID-typedef
[2]: http://msdn.microsoft.com/en-us/library/windows/desktop/ms684873(v=vs.85).aspx
[3]: https://github.com/ariya/phantomjs/blob/f52044cd3106266aa8efc1fae05e8c923315a5e5/src/qt/src/corelib/io/qprocess.h#L57
[4]: http://code.google.com/p/phantomjs/issues", u"Yes, I've included `qt_windows.h` and PhantomJS compiles fine, e.g.:
````
#ifdef Q_OS_WIN32
#include <QtCore/qt_windows.h>
#endif
````", u'Fortunately, `delayCallback` is never called; but, this `isFunc` is a blatant error.  My bad...']
